export const loadLocalStorage = () => {
    if (localStorage.loaded != null) {
        return;
    }

    const hourglass = ["data:image/jpeg;base64,",
        "data:image/jpeg;base64,"
        , "data:image/jpeg;base64,"];


    const apple = ["data:image/jpeg;base64,",

        "data:image/jpeg;base64,",

        "data:image/jpeg;base64,"
    ];

    const pear = ["data:image/jpeg;base64,",

        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,"
    ];

    const triangle = ["data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,"
    ];

    const rectangle = ["data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,"
    ];

    localStorage.setItem("hourglass", JSON.stringify(hourglass));
    localStorage.setItem("apple", JSON.stringify(apple));
    localStorage.setItem("pear", JSON.stringify(pear));
    localStorage.setItem("triangle", JSON.stringify(triangle));
    localStorage.setItem("rectangle", JSON.stringify(rectangle));
    localStorage.setItem("loaded", "true");
};

export const getFromLocalStorage = (name) => {
    return JSON.parse(localStorage[name]);
};